import React, { Component } from 'react'

class Opener extends Component {
    constructor(){
        state = {
            message: "Hey, I'm Matthew. I'm a hobbyist programmer and a recent graduate looking to make my way into software development.",
            img: '../Media/images/matthew.jpg'
        }
    }

    render(){
        return(
            <div>
                <img id = 'myImage' src= {state.img} alt = {'Matthew Abrey\'s picture'}/>
                <p id = 'openingMessage'>{state.message}</p>
            </div>
        );
    }
}
export default Opener
